	@Test
	public void testSimple() throws Exception {
		Map<Character,String> transf1 = new HashMap<Character, String>();
		transf1.put('a', "ca");
		transf1.put('d', "pip");
		transf1.put('u', "as");
		Map<Character,String> transf2 = new HashMap<Character, String>();
		transf2.put('p', "vt");
		transf2.put('e', "yt");

		List<Character> persons = Arrays.asList('a','b','a','d','r','e','c');
		List<Map<Character,String>> series = Arrays.asList(transf1,transf2);
		
		CloningSolver solver = new CloningSolver(persons, series);
		Assert.assertEquals("81f63bcb2f85d1f1118df246f588c4d1", solver.solveProblem());
	}
	
